// ReLU activation function
double relu(double x) {
    return (x > 0) ? x : 0;
}

// Convolution layer 1
void conv2d_layer1(double input[INPUT_SIZE][INPUT_SIZE], 
                   double output[CONV1_FILTERS][CONV1_OUTPUT_SIZE][CONV1_OUTPUT_SIZE]) {
    for (int f = 0; f < CONV1_FILTERS; f++) {
        for (int i = 0; i < CONV1_OUTPUT_SIZE; i++) {
            for (int j = 0; j < CONV1_OUTPUT_SIZE; j++) {
                output[f][i][j] = 0;
                for (int m = 0; m < CONV1_KERNEL_SIZE; m++) {		// 5x5 kernel
                    for (int n = 0; n < CONV1_KERNEL_SIZE; n++) {	// 
                        output[f][i][j] += input[i+m][j+n] * conv1_weights[f][0][m][n];
                    }
                }
                output[f][i][j] += conv1_biases[f]; 		// add bias
                output[f][i][j] = relu(output[f][i][j]); 	// apply ReLU
            }
        }
    }
}

// Convolution layer 2
void conv2d_layer2(double input[CONV1_FILTERS][POOL1_OUTPUT_SIZE][POOL1_OUTPUT_SIZE], 
                   double output[CONV2_FILTERS][CONV2_OUTPUT_SIZE][CONV2_OUTPUT_SIZE]) {
    for (int f = 0; f < CONV2_FILTERS; f++) {
        for (int i = 0; i < CONV2_OUTPUT_SIZE; i++) {
            for (int j = 0; j < CONV2_OUTPUT_SIZE; j++) {
                output[f][i][j] = 0;
                for (int m = 0; m < CONV2_KERNEL_SIZE; m++) {		// 5x5 kernel
                    for (int n = 0; n < CONV2_KERNEL_SIZE; n++) {	// 
                        for (int c = 0; c < CONV1_FILTERS; c++) { 	// 6 channels from layer 1
                            output[f][i][j] += input[c][i+m][j+n] * conv2_weights[f][c][m][n];
                        }
                    }
                }
                output[f][i][j] += conv2_biases[f]; 		// add bias
                output[f][i][j] = relu(output[f][i][j]); 	// apply ReLU
            }
        }
    }
}

// Max Pooling layer 1
void max_pool1(double input[CONV1_FILTERS][CONV1_OUTPUT_SIZE][CONV1_OUTPUT_SIZE], 
               double output[CONV1_FILTERS][POOL1_OUTPUT_SIZE][POOL1_OUTPUT_SIZE]) {
    for (int f = 0; f < CONV1_FILTERS; f++) {
        for (int i = 0; i < POOL1_OUTPUT_SIZE; i++) {
            for (int j = 0; j < POOL1_OUTPUT_SIZE; j++) {
                double max_val = input[f][i*2][j*2];
                for (int m = 0; m < 2; m++) {
                    for (int n = 0; n < 2; n++) { // max pooling in 3x3 box
                        max_val = (max_val > input[f][i*2+m][j*2+n]) ? max_val : input[f][i*2+m][j*2+n];
                    }
                }
                output[f][i][j] = max_val;
            }
        }
    }
}

// Max Pooling layer 2
void max_pool2(double input[CONV2_FILTERS][CONV2_OUTPUT_SIZE][CONV2_OUTPUT_SIZE], 
               double output[CONV2_FILTERS][POOL2_OUTPUT_SIZE][POOL2_OUTPUT_SIZE]) {
    for (int f = 0; f < CONV2_FILTERS; f++) {
        for (int i = 0; i < POOL2_OUTPUT_SIZE; i++) {
            for (int j = 0; j < POOL2_OUTPUT_SIZE; j++) {
                double max_val = input[f][i * 2][j * 2];
                for (int m = 0; m < 2; m++) {
                    for (int n = 0; n < 2; n++) {	// max pooling in 3x3 box
						max_val = (max_val > input[f][i*2+m][j*2+n]) ? max_val : input[f][i*2+m][j*2+n];
                    }
                }
                output[f][i][j] = max_val;
            }
        }
    }
}

// Flatten layer
void flatten(double input[CONV2_FILTERS][POOL2_OUTPUT_SIZE][POOL2_OUTPUT_SIZE],
             double output[CONV2_FILTERS * POOL2_OUTPUT_SIZE * POOL2_OUTPUT_SIZE]) {
    int idx = 0;
    for (int f = 0; f < CONV2_FILTERS; f++) {
        for (int i = 0; i < POOL2_OUTPUT_SIZE; i++) {
            for (int j = 0; j < POOL2_OUTPUT_SIZE; j++) {
                output[idx++] = input[f][i][j]; // flatten to 1D array
            }
        }
    }
}

// Fully Connected layer 1
void fully_connected_fc1(double input[], 
						 double output[], 
						 double weights[FC1_SIZE][CONV2_FILTERS * POOL2_OUTPUT_SIZE * POOL2_OUTPUT_SIZE], 
						 double biases[], 
						 int input_size, 
						 int output_size) {
	for (int i = 0; i < output_size; i++) { // iterate each output node
		output[i] = 0;
		for (int j = 0; j < input_size; j++) {
			output[i] += input[j] * weights[i][j]; // contribute from each input
		}
		output[i] += biases[i]; // add bias term
	}
}

// Fully Connected layer 2
void fully_connected_fc2(double input[], 
						 double output[], 
						 double weights[FC2_SIZE][FC1_SIZE], 
						 double biases[], 
						 int input_size, 
						 int output_size) {
	for (int i = 0; i < output_size; i++) { // iterate each output node
		output[i] = 0;
		for (int j = 0; j < input_size; j++) {
			output[i] += input[j] * weights[i][j]; // contribute from each input
		}
		output[i] += biases[i]; // add bias term
	}
}

// Fully Connected layer 3
void fully_connected_fc3(double input[], 
						 double output[], 
						 double weights[OUTPUT_CLASSES][FC2_SIZE], 
						 double biases[], 
						 int input_size, 
						 int output_size) {
	for (int i = 0; i < output_size; i++) { // iterate each output node
		output[i] = 0;
		for (int j = 0; j < input_size; j++) {
			output[i] += input[j] * weights[i][j]; // contribute from each input
		}
		output[i] += biases[i]; // add bias term
	}
}

// Final Prediction
void predict(double output[OUTPUT_CLASSES],
             int *predict_class) {
    // output the classification result
    *predict_class = 0;
    double max_value = output[0];
    for (int i = 1; i < OUTPUT_CLASSES; i++) {
        if (output[i] > max_value) {
            max_value = output[i];
            *predict_class = i;
        }
    }
}
/* ******************** lenet model layers ******************** */


/* ******************** lenet function ******************** */
int lenet(double input_image[INPUT_SIZE][INPUT_SIZE]) {

    // convolution + max pooling layer
    conv2d_layer1(input_image, conv1_output);
    max_pool1(conv1_output, pool1_output);
    conv2d_layer2(pool1_output, conv2_output);
    max_pool2(conv2_output, pool2_output);

    // flatten layer
    flatten(pool2_output, fc_input);

	// fully connected layer
	fully_connected_fc1(fc_input, fc1_output, fc1_weights, fc1_biases, CONV2_FILTERS * POOL2_OUTPUT_SIZE * POOL2_OUTPUT_SIZE, FC1_SIZE);
	fully_connected_fc2(fc1_output, fc2_output, fc2_weights, fc2_biases, FC1_SIZE, FC2_SIZE);
	fully_connected_fc3(fc2_output, output, fc3_weights, fc3_biases, FC2_SIZE, OUTPUT_CLASSES);
    predict(output, &predict_class);

    return predict_class;
}
/* ******************** lenet function ******************** */


/* ******************** bilinear resize ******************** */
void bilinear_resize(int src[HEIGHT][WIDTH], double dst[INPUT_SIZE][INPUT_SIZE]) {
    double x_ratio = (double)(WIDTH - 1) / INPUT_SIZE;
    double y_ratio = (double)(HEIGHT - 1) / INPUT_SIZE;

    for (int y = 0; y < INPUT_SIZE; y++) {
        for (int x = 0; x < INPUT_SIZE; x++) {
            double gx = x * x_ratio;
            double gy = y * y_ratio;
            int x0 = (int)gx;
            int y0 = (int)gy;
            int x1 = (x0 + 1 < WIDTH)  ? x0 + 1 : x0;
            int y1 = (y0 + 1 < HEIGHT) ? y0 + 1 : y0;

            // get pixel values at 4 neighboring points
            int P00 = src[y0][x0]; // top-left
            int P10 = src[y0][x1]; // top-right
            int P01 = src[y1][x0]; // bottom-left
            int P11 = src[y1][x1]; // bottom-right

            // compute interpolation weights
            double dx = gx - x0;
            double dy = gy - y0;

            // bilinear interpolation formula
            double P_top = P00 * (1 - dx) + P10 * dx;
            double P_bot = P01 * (1 - dx) + P11 * dx;
            double pixel_value = P_top * (1 - dy) + P_bot * dy;

            // Normalize the pixel value to the [0.0, 1.0] range
            dst[y][x] = pixel_value / 255.0f;
        }
    }
}
/* ******************** bilinear resize ******************** */


/* ******************** hex display ******************** */
void hex_display(int digit) {
	int output = 0;
	switch (digit) { // 7-seg of number 0~9
	  	case 0: output = 0b0111111; break;
	  	case 1: output = 0b0000110; break;
	  	case 2: output = 0b1011011; break;
	  	case 3: output = 0b1001111; break;
	  	case 4: output = 0b1100110; break;
	  	case 5: output = 0b1101101; break;
	  	case 6: output = 0b1111101; break;
	  	case 7: output = 0b0000111; break;
	  	case 8: output = 0b1111111; break;
	  	case 9: output = 0b1101111; break;
	  	default: output = 0b000000; break;
	}
    *hex30 = 0x3d060000 + output;
    *hex54 = 0x5E06;
}

void clear_hex() {
	*hex30 = 0x3d060000;
    *hex54 = 0x5E06;
}
/* ******************** hex display ******************** */


/* ******************** PS2 controls ******************** */
void keyboard() {
	int PS2_data, RVALID;
	char byte3 = 0;     // last byte read
	*(PS2_ptr) = 0xFF;  // reset

	while (1) {
	  	PS2_data = *(PS2_ptr);       // read the Data register in the PS/2 port
	  	RVALID = PS2_data & 0x8000;  // extract the RVALID field
	  	if (RVALID) {
	    	byte3 = PS2_data & 0xFF;
	    	handle_key(byte3);
	  	}
	}
}

void handle_key(char key) {
  	pixel_buffer_start = *pixel_ctrl_ptr;

	y_pos_prev = y_pos;
	x_pos_prev = x_pos;

  	switch (key) {
		/* moving cursor position and drawing */
    	case 0x75:                               	// up arrow
    	  	if (y_pos - CIRCLE_RADIUS * 2 >= 0)     // check in bounds
    	  	  	y_pos -= CIRCLE_RADIUS * 2 / 4;		// sub from y pos
    	  	draw_circle(x_pos, y_pos, DRAW_COLOR);  // draw cursor
    	  	break;
    	case 0x72:                                  // down arrow
      		if (y_pos + CIRCLE_RADIUS * 2 < HEIGHT) // check in bounds
        		y_pos += CIRCLE_RADIUS * 2 / 4;     // add from y pos
        	draw_circle(x_pos, y_pos, DRAW_COLOR);  // draw cursor
      		break;
    	case 0x6B:                                  // left arrow
    	  	if (x_pos - CIRCLE_RADIUS * 2 >= 0)     // check in bounds
    	  		x_pos -= CIRCLE_RADIUS * 2 / 4;		// sub from x pos
    		draw_circle(x_pos, y_pos, DRAW_COLOR);  // draw cursor
    	  	break;
    	case 0x74:                                  // right arrow
    	  	if (x_pos + CIRCLE_RADIUS * 2 < WIDTH)  // check in bounds
    	    	x_pos += CIRCLE_RADIUS * 2 / 4;		// add from x pos
    	    draw_circle(x_pos, y_pos, DRAW_COLOR);  // draw cursor
    	  	break;
		
			/* only moving cursor position */
		case 0x1D: 									// W key
			if (y_pos - CIRCLE_RADIUS * 2 >= 0)		// check in bounds
				y_pos -= CIRCLE_RADIUS * 2 / 4;		// sub from y pos
			del_cursor();
			draw_cursor();							// update cursor pos
			break;
		case 0x1B: 									// S key
			if (y_pos + CIRCLE_RADIUS * 2 < HEIGHT) // check in bounds
				y_pos += CIRCLE_RADIUS * 2 / 4;		// add from y pos
			del_cursor();
			draw_cursor();							// update cursor pos
			break;
		case 0x1C: 									// A key
			if (x_pos - CIRCLE_RADIUS * 2 >= 0)		// check in bounds
				x_pos -= CIRCLE_RADIUS * 2 / 4;		// sub from x pos
			del_cursor();
			draw_cursor();							// update cursor pos
			break;
		case 0x23: 									// D key
			if (x_pos + CIRCLE_RADIUS * 2 < WIDTH)	// check in bounds
				x_pos += CIRCLE_RADIUS * 2 / 4;		// add from x pos
			del_cursor();
			draw_cursor();							// update cursor pos
			break;
		
		/* erase current cursor position */
		case 0x66:             						// backspace key
			draw_circle(x_pos, y_pos, BG_COLOR);	// erase current pos
      		break;
		
		/* capture and call inference */
    	case 0x5A:             						// enter key
			capture();								// capture current image
      		inference();							// call inference model
			disp_class();
      		break;
		
		/* clear entire display (reset) */
    	case 0x76:             						// esc key
      		clear_canvas();							// clear canvas section
			clear_hex();							// clear hex display
			x_pos =  WIDTH / 2;
			y_pos = HEIGHT / 2;
			draw_cursor();
      		break;
    	default:
      		break;
  	}
}
/* ******************** PS2 controls ******************** */


/* ******************** VGA display ******************** */
void init_vga() {
	pixel_buffer_start = *pixel_ctrl_ptr;
	clear_screen();							// wipe screen
	disp_class();							// setup side panel
	draw_cursor();  						// draw start cursor
}

void start() {
    pixel_buffer_start = *pixel_ctrl_ptr;
  
    // draw start screen
    for (int y = 0; y < SCREEN_HEIGHT; y++) {
        for (int x = 0; x < SCREEN_WIDTH; x++) {
            plot_pixel(x, y, start_screen[y][x]);
        }
    }
  
    int PS2_data, RVALID;
    char byte3 = 0;     // last byte read
    *(PS2_ptr) = 0xFF;  // reset
  
    while (1) {
        PS2_data = *(PS2_ptr);       // read the Data register in the PS/2 port
        RVALID = PS2_data & 0x8000;  // extract the RVALID field
        if (RVALID) {
            byte3 = PS2_data & 0xFF;
  
            if (byte3 == 0x29) {  // space pressed
                init_vga();
                break;
            }
        }
    }
}

void plot_pixel(int x, int y, short int line_color) {
  	volatile short int *one_pixel_address;
  	one_pixel_address = (volatile short int *)(pixel_buffer_start + (y << 10) + (x << 1));
  	*one_pixel_address = line_color;
}

void clear_screen() {
  	for (int x = 0; x < 320; x++) {
    	for (int y = 0; y < 240; y++) {
      		plot_pixel(x, y, BG_COLOR);  // draw black pixels
    	}
  	}
}

void clear_canvas() {
	// clear_canvas
	for (int x = 0; x < WIDTH; x++) {
    	for (int y = 0; y < HEIGHT; y++) {
      		plot_pixel(x, y, BG_COLOR);  // draw black pixels
    	}
  	}

	// clear percentage
	for (int i = 0; i < OUTPUT_CLASSES; i++) {
		for (int n = 0; n < 3; n++) {
			for (int y = 0; y < digit_height; y++) {
				for (int x = 0; x < digit_width; x++) {
					if (n == 2)
						plot_pixel(x + WIDTH + digit_width * (n + 1), y + (i * digit_height) + TITLE_HEIGHT, percent[y][x]);
					else if (n == 1)
						plot_pixel(x + WIDTH + digit_width * (n + 1), y + (i * digit_height) + TITLE_HEIGHT, digit[0][y][x]);
					else
						plot_pixel(x + WIDTH + digit_width * (n + 1), y + (i * digit_height) + TITLE_HEIGHT, BG_COLOR);
				}
			}
		}
	}

	// display grid
	for (int i = 0; i < SCREEN_HEIGHT; i++) {
		plot_pixel(WIDTH, i, DRAW_COLOR);
	}
	for (int i = 0; i < (SCREEN_HEIGHT - TITLE_HEIGHT); i++) {
		plot_pixel(WIDTH + digit_width, i + TITLE_HEIGHT, DRAW_COLOR);
	}

	for (int i = 0; i < OUTPUT_CLASSES; i++) {
		for (int x = 0; x < (SCREEN_WIDTH - WIDTH); x++) {
			plot_pixel(x + WIDTH, (i * digit_height) + TITLE_HEIGHT, DRAW_COLOR);
		}
	}
}

void draw_circle(int x_center, int y_center, short int color) {
  	int x = CIRCLE_RADIUS;
  	int y = 0;
  	int decision_over_2 = 1 - x;  // decision criterion divided by 2 evaluated at x=r, y=0

	del_cursor();
  	while (y <= x) {
    // draw horizontal lines between the points on the circle's circumference
    	for (int i = x_center - x; i <= x_center + x; i++) {
    	  	plot_pixel(i, y_center + y, color);  // octant 1 and 4
    	  	plot_pixel(i, y_center - y, color);  // octant 5 and 8
    	}
    	for (int i = x_center - y; i <= x_center + y; i++) {
    	  	plot_pixel(i, y_center + x, color);  // octant 2 and 3
    	  	plot_pixel(i, y_center - x, color);  // octant 6 and 7
    	}

    	y++;
    	if (decision_over_2 <= 0) {
    	  	decision_over_2 +=
    	      	2 * y + 1;  // change in decision criterion for y -> y+1
    	} else {
    	  	x--;
    	  	decision_over_2 += 2 * (y - x) + 1;  // change for y -> y+1, x -> x-1
    	}
  	}
	draw_cursor();
}

void del_cursor() {
	plot_pixel(x_pos_prev, y_pos_prev, color_prev);
}

void draw_cursor() {
	color_prev = *(short int *)(pixel_buffer_start + (y_pos << 10) + (x_pos << 1));
	plot_pixel(x_pos, y_pos, 0xF100);
}

void capture() {
    pixel_buffer_start = *pixel_ctrl_ptr;

    for (int y = 0; y < HEIGHT; y++) {
        for (int x = 0; x < WIDTH; x++) {
            short int pixel = 
                *(short int *)(pixel_buffer_start + (y << 10) + (x << 1));

            // rgb bits from the pixel
            int red = (pixel >> 11) & 0x1F;      // 5 bits for red
            int green = (pixel >> 5) & 0x3F;     // 6 bits for green
            int blue = pixel & 0x1F;             // 5 bits for blue

            // convert to 8-bit grayscale
            int gray = (red * 255 / 31 * 0.299) + 
                       (green * 255 / 63 * 0.587) + 
                       (blue * 255 / 31 * 0.114);

            // clamp to 0-255
            if (gray > 255) gray = 255;
            if (gray < 0) gray = 0;

            image[y][x] = (unsigned char)gray;
        }
    }
}

void disp_class() {
    double relu_sum = 0.0 + 0.001; // small offset to avoid zero division
	double probabilities[OUTPUT_CLASSES];
	int num[2];

	// display title
	for (int y = 0; y < TITLE_HEIGHT; y++) {
		for (int x = 0; x < (SCREEN_WIDTH - WIDTH); x++) {
			plot_pixel(x + WIDTH, y, title[y][x]);
		}
	}
	// display number categories
	for (int i = 0; i < OUTPUT_CLASSES; i++) {
		for (int y = 0; y < digit_height; y++) {
			for (int x = 0; x < digit_width; x++) {
				plot_pixel(x + WIDTH, y + (i * digit_height) + TITLE_HEIGHT, digit[i][y][x]);
			}
		}
	}
	
	// Calculate ReLU values and sum
	for (int i = 0; i < OUTPUT_CLASSES; i++) {
	    if (output[i] > 0.0) {
	        probabilities[i] = output[i];
	        relu_sum += probabilities[i];
	    } else {
	        probabilities[i] = 0.0;
	    }
	}

	// Normalize to get probabilities
	for (int i = 0; i < OUTPUT_CLASSES; i++) {
	    probabilities[i] /= relu_sum;
		num[0] = (int)(probabilities[i] * 100.0) % 10;
		num[1] = (int)(probabilities[i] * 100.0 / 10);
	    printf("Class %d: %.2f%%\n", i, probabilities[i] * 100.0);
		for (int n = 0; n < 3; n++) {
			for (int y = 0; y < digit_height; y++) {
				for (int x = 0; x < digit_width; x++) {
					if (n == 2)
						plot_pixel(x + WIDTH + digit_width * (n + 1), y + (i * digit_height) + TITLE_HEIGHT, percent[y][x]);
					else if (num[1 - n] == 0 && n == 0)
						plot_pixel(x + WIDTH + digit_width * (n + 1), y + (i * digit_height) + TITLE_HEIGHT, BG_COLOR);
					else
						plot_pixel(x + WIDTH + digit_width * (n + 1), y + (i * digit_height) + TITLE_HEIGHT, digit[num[1 - n]][y][x]);
				}
			}
		}
	}

	// display grid
	for (int i = 0; i < SCREEN_HEIGHT; i++) {
		plot_pixel(WIDTH, i, DRAW_COLOR);
	}
	for (int i = 0; i < (SCREEN_HEIGHT - TITLE_HEIGHT); i++) {
		plot_pixel(WIDTH + digit_width, i + TITLE_HEIGHT, DRAW_COLOR);
	}

	for (int i = 0; i < OUTPUT_CLASSES; i++) {
		for (int x = 0; x < (SCREEN_WIDTH - WIDTH); x++) {
			plot_pixel(x + WIDTH, (i * digit_height) + TITLE_HEIGHT, DRAW_COLOR);
		}
	}
}
